import { getCarModels } from "../ApiRequests/CarModel";
import { getCarTypes } from "../ApiRequests/CarTypes";
import { getDriveTypes } from "../ApiRequests/DriveTypes";
import { getRentals } from "../ApiRequests/Rentals";
import { setCarModels, setCarTypes, setDriveType, setRentals } from "../redux/Actions";

export default reset = (dis) => {
    getCarModels()
        .then(x => {
            dis(setCarModels(x.data))
        })
        .catch(error => {
            console.log(error.message);
        })


    getCarTypes()
        .then(x => {
            dis(setCarTypes(x.data))
        })
        .catch(error => {
            console.log(error.message);
        })

    getDriveTypes()
        .then(x => {
            dis(setDriveType(x.data))
        })
        .catch(error => {
            console.log(error.message);
        })

    getRentals()
        .then(x => {
            dis(setRentals(x.data))
        })
        .catch(error => {
            console.log(error.message);
        })
}
